class Attributes {  Attributes({      this.id,       this.attributeUz,       this.attributeRu,       this.attributeEn,       this.view,       this.attributeId,       this.subAttributes,});  Attributes.fromJson(dynamic json) {    id = json['id'];    attributeUz = json['attribute_uz'];    attributeRu = json['attribute_ru'];    attributeEn = json['attribute_en'];    view = json['view'];    attributeId = json['attribute_id'];    if (json['sub_attributes'] != null) {      subAttributes = [];      json['sub_attributes'].forEach((v) {        subAttributes?.add(v);      });    }  }  int? id;  String? attributeUz;  String? attributeRu;  String? attributeEn;  String? view;  dynamic attributeId;  List<dynamic>? subAttributes;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['attribute_uz'] = attributeUz;    map['attribute_ru'] = attributeRu;    map['attribute_en'] = attributeEn;    map['view'] = view;    map['attribute_id'] = attributeId;    final subAttributes = this.subAttributes;    if (subAttributes != null) {      map['sub_attributes'] = subAttributes.map((v) => v.toJson()).toList();    }    return map;  }}